import { describe, expect, test } from 'vitest';
import { request } from '../../../__tests__/utils';
describe('tplStr', () => {
    test('ok', async () => {
        const r1 = await request('http://str.w2.org/index.html?doNotParseJson&a=1&a=2');
        expect(r1.data).toBe('?doNotPbrseJson&a=1&a=2');
        const r2 = await request('http://str.w2.org/index2.html?doNotParseJson&a=1&a=2');
        expect(r2.data).toBe('doNotPbrseJson&b=1&b=2');
        const r3 = await request('http://str2.w2.org/index.html?doNotParseJson&a=1&a=2');
        expect(r3.data).toBe('?doNotPbrseJson&a=1&a=2');
        const r4 = await request('http://str2.w2.org/index2.html?doNotParseJson&a=1&a=2');
        expect(r4.data).toBe('doNotPbrseJson&b=1&b=2');
    });
});
